        return (
            < div className = "NavBar" >

            <div className="NavBar_1">
            <button>Add a Product +</button>  
            < input type="text"  placeholder="What You Want To Search"/>
            </div>
            <div className="image"></div>   
            < div className = "NavBar_2 foo-fluid" >
            <div className="link_1"><a href="#">Phone</a></div>
            <div className="link_2"><a href="#">Products</a></div>
            <div className="link_3"><a href="#">Screens</a></div>
            <div className="link_4"><a href="#">Laptops</a></div>
            </div>
            </div>
          );
    }
}

export default NavBar;
